import React, { Component } from 'react';
import logo from './bad.png';
import './App.css';
import RangeSliderLadder from './rangeslider_ladder';



class App extends Component {
  render () {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} alt='whoops'/>
          <p/>
          <RangeSliderLadder />
          <img src={logo} alt='whoops'/>
        </header>
      </div>
    );
  }
}

export default App;
